def Display3D(sitk_im):
    plt.figure(figsize=(10, 3))

    fontsize = 12

    image = sitk.GetArrayFromImage(sitk_im)

    # get centre voxel
    s = np.array(image.shape)
    s = np.around(s / 2).astype(int)

