# Define the N4ITK bias field correction function
def correct_bias_field(image, shrink_factor=4, num_iterations=[50, 50, 30, 20]):
    # Convert the input image to float
    input_image = sitk.Cast(image, sitk.sitkFloat32)

    # Reduce the image resolution to speed up computation
    shrink_filter = sitk.ShrinkImageFilter()
    shrink_filter.SetShrinkFactors([shrink_factor]*3)
    input_image_shrunk = shrink_filter.Execute(input_image)

    # Execute N4ITK bias field correction algorithm
    corrector = sitk.N4BiasFieldCorrectionImageFilter()
    corrector.SetMaximumNumberOfIterations(num_iterations)
    corrected_image_shrunk = corrector.Execute(input_image_shrunk)

    # Compute the bias field and apply it to the original input image
    bias_field = sitk.Divide(input_image_shrunk, corrected_image_shrunk)
    bias_field_full_res = sitk.Expand(bias_field, [shrink_factor]*3)
    corrected_image = sitk.Divide(input_image, bias_field_full_res)

    return corrected_image

# Correct the intensity bias field for each MRI image
