def get_image_orientation(sitk_image):
    """
    This code defines a function get_image_orientation that takes a SimpleITK image object as input
    and returns a tuple of axis orientations based on the image's direction cosine matrix. The
    direction cosine matrix is a 3x3 matrix that describes the orientation and spacing of the
    image's axes in physical space. This code is aimed at determining the orientation of medical
    images in physical space.
    """

    dcm = sitk_image.GetDirection()

    # Create the direction cosine matrix
    dcm_matrix = np.array(dcm).reshape(3, 3)
    axis_orientations = []

    # Define the orientation labels for each axis
    orientation_labels = {
        0: ("S", "I"),  # Superior-Inferior
        1: ("R", "L"),  # Right-Left
        2: ("A", "P"),  # Anterior-Posterior
    }

    # Iterate through the columns of the direction cosine matrix
    for col_idx in range(3):
        column = dcm_matrix[:, col_idx]
        max_idx = np.argmax(np.abs(column))
        axis_orientation = orientation_labels[max_idx][int(column[max_idx] < 0)]
        axis_orientations.append(axis_orientation)

    return tuple(axis_orientations)

