# Define the affine registration function
def AffineRegistration(fixed_image, moving_image):

    affine_registration = sitk.ImageRegistrationMethod() # Create an instance
    affine_registration.SetMetricAsMattesMutualInformation(numberOfHistogramBins=256) # Similarity metric and the number of bins used in the histogram calculation is 256
    affine_registration.SetMetricSamplingStrategy(affine_registration.RANDOM) # The sampling strategy for the indicators was set to a random sample
    affine_registration.SetMetricSamplingPercentage(0.2) # Set the percentage of pixels used for metric sampling to 20%
    affine_registration.SetInterpolator(sitk.sitkLinear) # Set the interpolation method used for resampling to linear interpolation

    # Set the transform to be affine
    initial_transform = sitk.AffineTransform(3)
    affine_registration.SetInitialTransform(initial_transform)

    # Set up the optimiser for registration to gradient down in regular steps.
    affine_registration.SetOptimizerAsRegularStepGradientDescent(learningRate=2.0,
                                           minStep=1e-4,
                                           numberOfIterations=20,
                                           gradientMagnitudeTolerance=1e-7)

    # Set the scale of the optimiser according to the shift in index space
    affine_registration.SetOptimizerScalesFromIndexShift()


    return affine_registration.Execute(fixed_image, moving_image)

