# Create segmentation from probability maps
def create_segmentation(sitk_image,ind,p):
    image = sitk.GetArrayFromImage(sitk_image)
    labels=np.argmax(p,1)
    seg = np.zeros(image.shape).astype('float32')
    seg[ind]=labels+1
    sitk_seg=sitk.GetImageFromArray(seg)
    sitk_seg.CopyInformation(sitk_image)
    return sitk_seg

# Gaussian function
def gauss(x,m,v):
    g = np.exp(-(x-m)**2/v)/((6.28*v)**0.5)+1e-10
    return g

# E-step for GMM
def update_probability_EM(features,means,variances):
    p=np.zeros([features.shape[0],3])
    for k in range(3):
        p[:,k] = gauss(features.flatten(),means[k],variances[k])
    denom = np.matlib.repmat(np.sum(p,1), 3, 1).T
    p=p/denom
    return p

# M-step for GMM
def update_parameters_EM(features,p):
    n=p.shape[0]
    means=np.zeros(3)
    variances=np.zeros(3)
    for k in range(0,3):
        means[k]=np.sum(p[:,k]*features.flatten())/np.sum(p[:,k])
        variances[k]=np.sum(p[:,k]*(features.flatten()-means[k])**2)/np.sum(p[:,k])
    return means,variances

def GMM_EM_MRF(sitk_image, image_masked, wm_reg, gm_reg, csf_reg, num_iterations=10, beta=1.0):
    # Extract non-zero values and reshape them into a feature vector for sklearn
    ind = np.where(image_masked > 0)
    data = image_masked[ind]
    features = data.reshape(-1, 1)

    # Extract prior probabilities for non-zero voxels
    a_wm = wm_reg[ind]
    a_gm = gm_reg[ind]
    a_csf = csf_reg[ind]

    # Stack them into a single vector
    a = np.stack([a_csf, a_gm, a_wm], axis=1)

    # Initialize the GMM model using the priori informations
    gmm = GaussianMixture(n_components=3, init_params='kmeans')
    gmm.means_ = a.mean(axis=0).reshape(-1, 1)
    gmm.covariances_ = np.stack([np.var(a[:, i]) for i in range(3)]).reshape(-1, 1, 1)

    # Fit the GMM model using EM algorithm
    gmm.fit(features)

    # Update the GMM parameters
    means = gmm.means_.flatten()
    variances = gmm.covariances_.flatten()

    # Run the EM algorithm using the updated parameters with MRF regularization
    for i in range(num_iterations):
        # E-step
        p = update_probability_EM(features, means, variances)

        # M-step
        means, variances = update_parameters_EM(features, p)

        # MRF denoising
        labels = np.argmax(p, axis=1) + 1 # Compute the tissue class (WM, GM, or CSF) with the highest probability for each voxel in the image
        for j in range(3):
            # Compute the indices of voxels that belong to the current tissue class
            ind_j = np.where(labels == j)[0]

            # Compute the indices of voxels that do not belong to the current tissue class
            ind_jc = np.where(labels != j)[0]

            # Calculate the number of voxels that belong to the current tissue class
            n_j = ind_j.shape[0]

            # Calculate the number of voxels that do not belong to the current tissue class
            n_jc = ind_jc.shape[0]

            # Ensure that the MRF denoising is only applied when there are voxels belonging to both the current tissue class and other tissue classes
            if n_j > 0 and n_jc > 0:
                # Compute the energy difference between the current tissue class and other tissue classes
                e = np.sum(np.abs(labels[ind_jc] - j)) * beta

                # Update the probabilities for the current tissue class by multiplying the probability by the exponential of the negative energy difference
                p[ind_j, j] *= np.exp(-e)

                # Normalize the probabilities
                p[ind_j, j] /= np.sum(p[ind_j, :])

    # Create the final segmentation using the updated parameters
    sitk_seg_EM = create_segmentation(sitk_image, ind, p)

    return sitk_seg_EM

