    gm_reg = sitk.GetArrayFromImage(sitk_gm_reg)

    # Register priori informations for WM to the current reference image using affine registration
    transform_wm = AffineRegistration(image, sitk_wm_reoriented)
    # Resample priori informations for WM to match the size, spacing, and orientation of the current reference image
    sitk_wm_reg = sitk.Resample(sitk_wm_reoriented, image, transform_wm, sitk.sitkLinear, 0.0, sitk_atlas.GetPixelID())
    # Convert to numpy
    wm_reg = sitk.GetArrayFromImage(sitk_wm_reg)

    # Register priori informations for CSF to the current reference image using affine registration
    transform_csf = AffineRegistration(image, sitk_csf_reoriented)
    # Resample priori informations for CSF to match the size, spacing, and orientation of the current reference image
    sitk_csf_reg = sitk.Resample(sitk_csf_reoriented, image, transform_csf, sitk.sitkLinear, 0.0, sitk_atlas.GetPixelID())
    # Convert to numpy
    csf_reg = sitk.GetArrayFromImage(sitk_csf_reg)

    sitk_seg_EM_mrf = GMM_EM_MRF(image, image_masked, wm_reg, gm_reg, csf_reg)
    Display3D(sitk_seg_EM_mrf)
    generated_brain_masks.append(sitk_seg_EM_mrf)

