def compute_dice(pred, gt):
    """Compute the Dice similarity coefficient between two binary images."""
    arr1 = sitk.GetArrayFromImage(pred).astype(bool)
    arr2 = sitk.GetArrayFromImage(gt).astype(bool)
    intersection = np.logical_and(arr1, arr2).sum()
    union = arr1.sum() + arr2.sum()
    dice = 2 * intersection / union if union > 0 else 1
    return dice

# Initialize a list to store the Dice coefficients for each pair of images
dice_scores = []

# Iterate over generated brain masks and ground truth tissue segmentations
for i, brain_mask in enumerate(generated_brain_masks):
    # Extract the corresponding ground truth tissue segmentation for the current brain mask
    tissue_seg = sitk_tissue_segs[i]

    # Compute Dice coefficient
    d = compute_dice(brain_mask, tissue_seg)

    # Append Dice coefficient to the list
    dice_scores.append(d)

    print(f"Dice for mask {i+1}: {d:.2f}")

# Compute the average Dice coefficient across all pairs of images
avg_dice = sum(dice_scores) / len(dice_scores)
print(f"Average Dice: {avg_dice:.2f}")

