# Define a global registration
def global_registration(fixed_image, moving_image):

    global_registration = sitk.ImageRegistrationMethod()
    global_registration.SetMetricAsMattesMutualInformation(numberOfHistogramBins=256)
    global_registration.SetMetricSamplingStrategy(global_registration.RANDOM)
    global_registration.SetMetricSamplingPercentage(0.2)
    global_registration.SetInterpolator(sitk.sitkLinear)

    # Set the transform to be affine
    initial_transform = sitk.AffineTransform(3)
    global_registration.SetInitialTransform(initial_transform)

    # Set up the optimiser for registration to gradient down in regular steps.
    global_registration.SetOptimizerAsRegularStepGradientDescent(learningRate=2.0,
                                           minStep=1e-4,
                                           numberOfIterations=20,
                                           gradientMagnitudeTolerance=1e-7)

    # Set the scale of the optimiser according to the shift in index space
    global_registration.SetOptimizerScalesFromIndexShift()


    return global_registration.Execute(fixed_image, moving_image)

# Define a local registration
def local_registration(fixed_image, moving_image, initial_transform, roi_radius=(128,128,64)):
    local_registration = sitk.ImageRegistrationMethod()
    local_registration.SetMetricAsMattesMutualInformation(numberOfHistogramBins=256)
    local_registration.SetInterpolator(sitk.sitkLinear)
    local_registration.SetInitialTransform(initial_transform, inPlace=True)

    local_registration.SetOptimizerAsRegularStepGradientDescent(learningRate=2.0,
                                           minStep=1e-4,
                                           numberOfIterations=20,
                                           gradientMagnitudeTolerance=1e-7)

    local_registration.SetOptimizerScalesFromIndexShift()


    # Define ROI centered at the centroid of the fixed_image
    fixed_roi = sitk.RegionOfInterest(fixed_image, roi_radius,
                                      [int((s - r)/2) for s, r in zip(fixed_image.GetSize(), roi_radius)])

    # Perform local registration
    local_transform = local_registration.Execute(fixed_roi, moving_image)

    return local_transform

# Define a propagate function
def propagate_segmentations(fixed_image, moving_image, transformation=None):
  if transformation is None:
    res = sitk.Resample(moving_image, fixed_image,  sitk.Transform(), sitk.sitkLinear, 0.0, moving_image.GetPixelID())
  else:
    res = sitk.Resample(moving_image, fixed_image,  transformation, sitk.sitkLinear, 0.0, moving_image.GetPixelID())
  return res

# Define a weighted majority voting approach
def weighted_majority_voting(segmentations, weights):
    weighted_sum = np.zeros(segmentations[0].shape)

    for seg, weight in zip(segmentations, weights):
        weighted_sum += seg * weight

    consensus_segmentation = (weighted_sum >= 0.2 * np.sum(weights)).astype(np.uint8)
    return sitk.GetImageFromArray(consensus_segmentation)


# Define a single-atlas segmentation function
def single_atlas_segmentation(target_image, atlas_image, atlas_segmentation):
    global_transform = global_registration(target_image, atlas_image)
    local_transform = local_registration(target_image, atlas_image, global_transform)

    propagated_segmentation = propagate_segmentations(target_image, atlas_segmentation, local_transform)
    return propagated_segmentation

# Define a multi-atlas segmentation function
def multi_atlas_segmentation(target_image, atlas_images, atlas_segmentations, weights=None):
    propagated_segmentations = []

    if weights is None:
        weights = np.ones(len(atlas_images))

    for atlas_image, atlas_segmentation in zip(atlas_images, atlas_segmentations):
        propagated_segmentation = single_atlas_segmentation(target_image, atlas_image, atlas_segmentation)
        propagated_segmentations.append(sitk.GetArrayFromImage(propagated_segmentation))

    consensus_segmentation = weighted_majority_voting(propagated_segmentations, weights)
    return consensus_segmentation

# Set up weights based on the the corresponding hippocampal segmentation and similarity to the target image
weights = np.array([0.5, 0.4, 0.4, 0.4, 0.2, 0.4, 0.4, 0.4, 0.4])
normalized_weights = weights / np.sum(weights)

# Perform single-atlas segmentation using the first atlas image and segmentation
single_atlas_result = single_atlas_segmentation(target_image, atlases_images[0], atlas_hippocampus_segs[0])

# Perform multi-atlas segmentation using all atlas images and segmentations
